'use babel'
'use strict'

const $ = require('jquery')
const path = require('path')
const qrcode = require('./generateQRCode')

module.exports = class QRCodeView {
  constructor () {
    this.qrcodePath = path.join(atom.configDirPath, 'storage', 'qr.png')

    let d = document.createElement('div')

    this.panel = atom.workspace.addModalPanel({
      item: $(d).addClass('weex-run qrcode-panel loading'),
      visable: false
    })

    var tiltediv = document.createElement("div");
    tiltediv.innerHTML = "Add Real Runtime Device"
    tiltediv.className = "weexRunTitle"

    let d2 = document.createElement('div')

    this.loadingInspector = document.createElement('i')
    $(this.loadingInspector).addClass('fa fa-5x fa-spinner fa-spin')

    $(d2).append($(this.loadingInspector))


    // modify panel classes
    $(d).parent().addClass('weex-run qrcode-panel')

    this.qrImage = document.createElement('img')
    $(d2).append($(this.qrImage).hide().addClass('weex-run qrcode'))

    var describeContext = document.createElement("div");
    describeContext.innerHTML = "Real devices needs you scan QR code to added with use of Oreo-Perview APP"
    describeContext.className = "weexDescribe"



    var imgForGuide = document.createElement('img')
    imgForGuide.setAttribute("src","data:image/png;base64,")
    imgForGuide.className = "weexRunImg"

    $(d).append(tiltediv);
    $(d).append(d2);
    $(d).append(describeContext);
    $(d).append(imgForGuide);
  }

  generateQRCode (content) {
    if (content) {
      return qrcode.generate(content, this.qrcodePath, 200)
    } else {
      return Promise.resolve(this.qrcodePath)
    }
  }

  displayQRCode () {
    $(this.qrImage).attr('src', this.qrcodePath).show()
    $(this.loadingInspector).hide()
  }

  show () {
    this.previousClickEvt = window.onclick
    window.onclick = this.dismiss.bind(this)
    this.panel.show()
  }

  dismiss () {
    this.panel.hide()
    $(this.loadingInspector).show()
    $(this.qrImage).hide()
    window.onclick = this.previousClickEvt
  }
}
